import React, { Component } from 'react'

class ClickCounter extends Component {
    constructor(props) {
      super(props)
    
      this.state = {
         count : 0
      }
    }
    
    render() {
        return 
            <button>Clicked X times</button>
        
    }
}

export default ClickCounter
